import React from 'react';
import styled from 'styled-components';

const ThemesContainer = styled.div`
  margin-top: 50px;
`;

const ThemesTitle = styled.h2`
  font-size: 2.5em;
  color: #3498db; /* Blue color for "NEW IN" */
`;

const SmallBox = styled.span`
  background-color: #3498db; /* Blue background */
  color: #000; /* Black font color */
  padding: 2px 6px;
  border-radius: 3px;
  font-size: 0.8em; /* Smaller font size */
  display: inline-block;
`;

const ThemesSubtitle = styled.p`
  font-size: 1.2em;
  margin: 10px 0;
  color: #fff;
`;

const ThemesGrid = styled.div`
  display: flex;
  justify-content: center;
  gap: 20px;
  margin-top: 30px;
`;

const ThemeCard = styled.div`
  background-color: #fff;
  color: #000;
  border-radius: 10px;
  overflow: hidden;
  width: 200px;
  text-align: left;
`;

const ThemeImage = styled.img`
  width: 100%;
  height: auto;
`;

const ThemeInfo = styled.div`
  padding: 10px;
`;

const ThemeTitle = styled.h3`
  font-size: 1.2em;
  margin: 0;
`;

const ThemeSubtitle = styled.p`
  font-size: 1em;
  color: #555;
`;

const FeatureContainer = styled.div`
  display: flex;
  justify-content: center;
  gap: 20px;
  margin-top: 30px;
  flex-wrap: wrap;
`;

const FeatureBox = styled.div`
  background-color: #1a1a1a;
  color: #fff;
  padding: 20px;
  border-radius: 10px;
  width: 300px;
  text-align: left;
`;

const FeatureTitle = styled.h3`
  font-size: 1.5em;
  margin: 0 0 10px 0;
`;

const FeatureSubtitle = styled.p`
  font-size: 1.1em;
  color: #ccc;
`;

const ThemesSection = () => {
  return (
    <ThemesContainer>
      <ThemesTitle>NEW IN <SmallBox>2.0</SmallBox></ThemesTitle>
      <ThemesSubtitle>
        Themes. Unlimited themes.
      </ThemesSubtitle>
      <ThemesSubtitle>
        Themes in Sleeve make creating and switching between customizations easy. Share your own creations with friends and install as many themes as you like with just a double-click.
      </ThemesSubtitle>
      <ThemesGrid>
        <ThemeCard>
          <ThemeImage src="https://via.placeholder.com/200" alt="Eternal Sunshine" />
          <ThemeInfo>
            <ThemeTitle>Eternal Sunshine</ThemeTitle>
            <ThemeSubtitle>Forgotten Feels<br />Slow Magic</ThemeSubtitle>
          </ThemeInfo>
        </ThemeCard>
        <ThemeCard>
          <ThemeImage src="https://via.placeholder.com/200" alt="Bunny Is a Rider" />
          <ThemeInfo>
            <ThemeTitle>Bunny Is a Rider</ThemeTitle>
            <ThemeSubtitle>Desire, I Want to Turn Into You<br />Caroline Polachek</ThemeSubtitle>
          </ThemeInfo>
        </ThemeCard>
        <ThemeCard>
          <ThemeImage src="https://via.placeholder.com/200" alt="Are You Listening" />
          <ThemeInfo>
            <ThemeTitle>Are You Listening</ThemeTitle>
            <ThemeSubtitle>How to Be Human<br />Chelsea Cutler</ThemeSubtitle>
          </ThemeInfo>
        </ThemeCard>
        <ThemeCard>
          <ThemeImage src="https://via.placeholder.com/200" alt="Song Title" />
          <ThemeInfo>
            <ThemeTitle>Song Title</ThemeTitle>
            <ThemeSubtitle>Album Title<br />Artist Name</ThemeSubtitle>
          </ThemeInfo>
        </ThemeCard>
      </ThemesGrid>
      <FeatureContainer>
        <FeatureBox>
          <FeatureTitle>Change it up</FeatureTitle>
          <FeatureSubtitle>Switch between themes with just a click. Modify the built-in themes or create your own using Sleeve’s extensive preferences.</FeatureSubtitle>
        </FeatureBox>
        <FeatureBox>
          <FeatureTitle>Shareable</FeatureTitle>
          <FeatureSubtitle>Export your themes and share them with friends using the handy new Sleeve Theme file format. Install themes from anywhere with a double-click or a drag and drop.</FeatureSubtitle>
        </FeatureBox>
      </FeatureContainer>
    </ThemesContainer>
  );
};

export default ThemesSection;
